import './App.css';
import React from 'react';
import jokesdata from './components/jokesdata';
import Jokes from './components/jokes';

function App() {
  const jokeElements = jokesdata.map((joke) => (
    <Jokes setp={joke.setp} punchline={joke.punchline} />
  ));

  return (
    <div className="App">
      {jokeElements}
    </div>
  );
}

export default App;
